on are \nDisplayed in a beautiful manner.A collective of ideas and choices in one bottle.\nHere, is some Amazon link which you can go for \n\n<br>\n<a href=\"https://www.amazon.in/dp/B08KSHG118/ref=cm_sw_r_cp_awdb_imm_PRNJN11TCTB86S7JP2KS?_encoding=UTF8&psc=1\"  alt=\"\" target=\"_blank\"> 1. Royal Art Clear Glass and Vintage Brass Decorative Square Jewelry Case for Home Decor</a>\n<br>\n\n<a href=\"https://dl.flipkart.com/dl/unravel-india-analog-wall-clock/p/itmeyax2zez7hyzp?pid=WCKEYAX2XGGSUHEF&cmpid=product.share.pp&_refId=PP.d81be5e9-0170-48df-b2cd-da94544ad39e.WCKEYAX2XGGSUHEF&_appId=WA\"  alt=\"\" target=\"_blank\">2. Vintage India Analog Wall Clock</a><br>\n\n<a href=\"https://www.amazon.in/dp/B08DKP7NQ6/ref=cm_sw_r_wa_awdb_imm_CF23HH5TE37CD4760HW7?_encoding=UTF8&psc=1\"  alt=\"\" target=\"_blank\"> 3. Indian Royals Black Damask</a><br>\nSo, What you are waiting for go it. Love is yours and our support is always there with you.<br><br>Lastly, Your cycle must revolve around reduce, reuse and recycle. And also go for online shopping to get affordable prices and fulfil your dream of vintage home decor. And you will surely crack it. And the passion of recreating the old memories definitely fulfilled. And pls do share your experiences with us.And build your house into home and make lots of memories with your family, friends and colleagues.\n by:- Priya Sonar\n ', '31.jpg', 'News', 'decor, vintage, vintage decor, decor vintage', '2021-07-31'),
(32, 131, 'testing blog', 'Identical to the mailto() function except it writes an obfuscated version of the mailto tag using ordinal numbers written with JavaScript to help prevent the e-mail address from being harvested by spam bots.\n\nauto_link($str, $type = \'both\', $popup = FALSE)\nParameters:	\n$str (string) – Input string\n$type (string) – Link type (‘email’, ‘url’ or ‘both’)\n$popup (bool) – Whether to create popup links\nReturns:	\nLinkified string\n\nReturn type:	\nstring\n\nAutomatically turns URLs and e-mail addresses contained in a string into links. Example:\n\n$string = auto_link($string);\nThe second parameter determines whether URLs and e-mails are converted or just one or the other. Default behavior is both if the parameter is not specified. E-mail links are encoded as safe_mailto() as shown above.\n\nConverts only URLs:\n\n$string = auto_link($string, \'url\');\nConverts only e-mail addresses:\n\n$string = auto_link($string, \'email\');\nThe third parameter determines whether links are shown in a new window. The value can be TRUE or FALSE (boolean):\n\n$string = auto_link($string, \'both\', TRUE);\nurl_title($str, $separator = \'-\', $lowercase = FALSE)\nParameters:	\n$str (string) – Input string\n$separator (string) – Word separator\n$lowercase (bool) – Whether to transform the output string to lower-case\nReturns:	\nURL-formatted string\n\nReturn type:	\nstring\n\nTakes a string as input and creates a human-friendly URL string. This is useful if, for example, you have a blog in which you’d like to use the title of your entries in the URL. Example:\n\n$title = \"What\'s wrong with CSS?\";\n$url_title = url_title($title);\n// Produces: Whats-wrong-with-CSS\nThe second parameter determines the word delimiter. By default dashes are used. Preferred options are: - (dash) or _ (underscore)\n\nExample:\n\n$title = \"What\'s wrong with CSS?\";\n$url_title = url_title($title, \'underscore\');\n// Produces: Whats_wrong_with_CSS\nNote\n\nOld usage of ‘dash’ and ‘underscore’ as the second parameter is DEPRECATED.\n\nThe third parameter determines whether or not lowercase characters are forced. By default they are not. Options are boolean TRUE/FALSE.\n\nExample:\n\n$title = \"What\'s wrong with CSS?\";\n$url_title = url_title($title, \'underscore\', TRUE);\n// Produces: whats_wrong_with_css\nprep_url($str = \'\')\nParameters:	\n$str (string) – URL string\nReturns:	\nProtocol-prefixed URL string\n\nReturn type:	\nstring\n\nThis function will add http:// in the event that a protocol prefix is missing from a URL.\n\nPass the URL string to the function like this:\n\n$url = prep_url(\'example.com\');\nredirect($uri = \'\', $method = \'auto\', $code = NULL)\nParameters:	\n$uri (string) – URI string\n$method (string) – Redirect method (‘auto’, ‘location’ or ‘refresh’)\n$code (string) – HTTP Response code (usually 302 or 303)\nReturn type:	\nvoid\n\nDoes a “header redirect” to the URI specified. If you specify the full site URL that link will be built, but for local links simply providing the URI segments to the controller you want to direct to will create the link. The function will build the URL based on your config file values.\n\nThe optional second parameter allows you to force a particular redirection method. The available methods are auto, location and refresh, with location being faster but less reliable on IIS servers. The default is auto, which will attempt to intelligently choose the method based on the server environment.\n\nThe optional third parameter allows you to send a specific HTTP Response Code - this could be used for example to create 301 redirects for search engine purposes. The default Response Code is 302. The third parameter is only available with location redirects, and not refresh. Examples:\n\nif ($logged_in == FALSE)\n{\n        redirect(\'/login/form/\');\n}\n\n// with 301 redirect\nredirect(\'/article/13\', \'location\', 301);\nNote\n\n\n<a href=\"https://localhost/git_shareshell/shareshell/main/blog/30/vintage-house\" target=\"_blank\"> </a>\n\n<a href=\"https://jsfiddle.net/easyjs/boxn9p1j/\" target=\"_blank\"> </a>\n\n\n\n<img src=\"https://www.gardeningknowhow.com/wp-content/uploads/2020/12/lonely-japanese-cherry.jpg\"  style=\"height:300px; width:auto; display:block; margin-left:auto; margin-right:auto;\" alt=\"trees\">', '32.jpg', 'Home', 'trees, hello world', '2021-08-01'),
(33, 130, 'heading ', '<h1>hello</h1>\n<h2>hejdsf</h2>\n\n\n<img src=\"https://cdn.pixabay.com/photo/2015/04/23/22/00/tree-736885__480.jpg\"  style=\"height:300px; width:auto; display:block; margin-left:auto; margin-right:auto;\" alt=\"sunset\">\n\n\n<a href=\"https://google.com\" target=\"_blank\">click me </a>  \n<a href=\"https://localhost/git_shareshell/sharehsell\" target=\"_blank\">click me </a>  \nShoom was a weekly all-nighter dance music event held at nightclubs in London, England, between December 1987 and early 1990. It is widely credited with initiating the acid house movement in the UK. Shoom was founded by Danny Rampling and managed by his wife Jenni. It began at a 300-capacity basement gym on Southwark Street in South London. By May 1988 its growing popularity necessitated a move to the larger Raw venue on Tottenham Court Road, Central London, and a switch from Saturday to Thursday nights. Later relocations were to The Park nightclub in Kensington and Busby\'s venue on Charing Cross Road. The early nights featured Chicago house and Detroit techno, mixed with contemporary pop and post-punk. Its musical and visual culture evolved around the classical hallucinogenic drug LSD and the psychoactive drug MDMA, the latter commonly known in the UK as ecstasy or \"E\". Shoom closed shortly after open drug use at the club began to attract police attention. By this time, electronic music had crossed into the mainstream as the heavier sounding rave style became popular. (Full article...)\nRecently featured: Henry IV, Holy Roman EmperorSouth Park: The Stick of TruthYork County, Maine, Tercentenary half dollar\nArchiveBy emailMore featured articles\nDid you know ...\nLever House\nLever House\n... that Lever House (pictured), slated for replacement with a larger building in the 1980s, was protected as a New York City landmark with a one-vote majority?\n... that psychologist Janis Sanchez-Hucles was only the second person of color to earn a PhD in psychology from the University of North Carolina?\n... that the Pomme d\'Or Hotel was used as the Nazi naval headquarters during the occupation of Jersey, and the Union Jack is raised on the hotel balcony every year to celebrate Jersey\'s libera', '33.png', 'Home', 'hello world, check me, triea', '2021-08-08'),
