(35, 131, 'helols', 'Everything in India is governed by some fundamentals laws similarly real estate in India is also governed by some fundamental laws and those laws change state to state. This is because, by Article 246 of the constitution of India, ‘land’ is the subject matter of state list or list-2 of the seventh schedule to the constitution of India, which covers subjects for which only states can legislate, while ‘ Transfer of property other than agricultural land, registration of deeds and documents and ‘contracts other than for agricultural lands’ Fall under the concurrent list or list-3 of the seventh schedule to the constitution of India, which are subjects for which both central and state can legislate. Some major laws that affect real estate in India are the real estate ( Regulation and Development) Act,2016( RERA), the registration Act,1908. Right to fair compensation and transparency in land Acquisition, Rehabilitation and Resettlement Act,2013.<br>\n<h4>List of fundamental laws Governing real estate in India:-</h4>\n<ul>\n<li><h5>Transfer of Property Act,1882</h5>\n<p>This central act is all about providing general principles of movables and immovable property, such as sale exchange, lease, mortgage, and the gift of property, part of per performance and lis pendens.</p>\n\n<li><h5>Indian contract Act,1872</h5>\n\n<p>This act governs the law regarding contracts in India including the capacity to enter into a contract, execution, and implementation thereof, breach, and remedies available to the signs in case of issue. The chapter and section of the transfer of property act,1882 which relate to contract shall be taken as a path of the India contract act 1872.</p>\n\n<li><h5>Indian easement Act,1882</h5>\n\n<p>This act governs the law regarding easement’s right to\nimmovable property.</p>\n<li><h5>Indian stamp Act,1899 and Registration Act, 1908</h5>\n\n<p>This act is all about governing the laws related to the need for\nthe registration of different types of various deeds, instruments,\nand documents related to the transfer of an interest in\nimmovable property and the payment of duty on the same.\n</p>\n\n<li><h5>The Real Estate (Regulation and Development)Act,\n2016( RERA)</h5>\n\n<p>\nTHIS Act governs the development, marketing, and sale of\nreality projects to safeguard consumer’s interests in the real\nestate sector. This Act also established an adjudicating \nmechanism for speedy dispute redressed vide the real estate\nRegulation authority and the appellate tribunal and mandates\ncompulsory registration of project and key players in the real\nestate sector. States have adopted they are corresponding RERA\nregulations to make sure that the central Act is implementation\nthe local level.\n</p>\n\n<li><h5>Land Revenue codes</h5>\n\n<p>All the states in India have formulated their own land revenue\nrules which govern laws relating to the agricultural land holiday,\nland revenue, type of tenancy, and matters connected thereto.\nThe code encapsulated divisions and classes of immovable\nproperty in the state, restrictions and transfer thereto, duties\nand powers of revenue officers, rules and regulations, and\npenalties for contravention of such code.</p>\n\n<li><h5>Right to fair compensation and transparency in land\nAcquisition, Rehabilitation and Resettlement Act, 2013\n</h5>\n\n<p>This Act governs the law regarding the acquisition of private land\nparcels by the government fir a company or specific public\npurposes.</p>\n\n<li><h5> Foreign Exchange Management Act, 1999(FEMA) and\nForeign Direct Investment Policy (FDI policy)\n</h5>\n\n<p>FEMA and regulations pursuant thereto govern the purchase/\nsale of immovable property in India by foreign entities. Foreign\ninvestment is regulated by the Department of Industrial Policy\nand Promotion (DIPP), the Foreign Investment Promotion\nBoard(FIPB), and the Reserve Bank of India (RBI).\nIn addition to the above laws, the real estate sector in India is\nalso governed by various state local, municipal laws, policies, and\ncustoms, including nuances in respect of urban development.</p>\n\n</ul>\n\n<h4>Documents to check before buying a new\nproperty</h4>\n\n\n<div style=\"display: flex; justify-content:space-around;\" class=\"double_image\">\n<img src=\"https://www.shareshell.in//utility/blog_image/addon/1628887668616.jpg\"  style=\"width:47%; height:300px; object-fit:cover;\" alt=\"papers\">\n<img src=\"https://www.shareshell.in//utility/blog_image/addon/1628887775096.jpg\"  style=\"width:47%; height:300px; object-fit:cover;\" alt=\"submit\">\n</div>\n\n\n\n<ul>\n<li><h5>Sale Deed:</h5>\n<p>A Sale Deed is the core legal document that acts as proof of\nsale and transfer of ownership of the property from the\nseller to the buyer. A Sale Deed has to be mandatorily\nregistered. Before executing the Sale Deed, the buyer\nshould check whether the property has a clear title.</p>\n\n<li><h5> Mother Deed:</h5>\n<p>Mother Deed, also known as the parent document, is an\nan important legal document that traces the \norigin/antecedent ownership of the property from the start\n(if the property has had various owners).In the case of the\nabsence of the original Mother Deed, certified copies\nshould be obtained from the registering authorities.\nMother Deed includes the change in ownership of the\nproperty, be it through sale, partition, gift, or inheritance.\nIn case of a missing sequence, one should refer to the\nrecords from the registering offices, revenue records, or the\nrecitals (preamble) in other documents.</p>\n\n\n\n<li><h5>Building approval plan:</h5>\n<p>A building owner has to get an approved plan from the\njurisdictional Commissioner or an officer authorized by such\nCommissioner. However, the authorities sanction a building\napproval plan based on the zonal classification, road width,\nfloor area ratio (FAR), and plot depth. A set of documents\nare required to be submitted by the owner to obtain a\nbuilding approval plan. The documents include- Title Deed,\nproperty assessment extract, property PID number, city\nsurvey sketch (from the Department of Survey and\nSettlement and Land Records), up-to-date tax paid receipt,\nearlier sanctioned plans (if any), property drawings, 2\ncopies of demand drafts, foundation certificate (if any) and\na land-use certificate issued by the competent authority\n(viz., Dy. Commissioner).</p>\n\n\n\n\n\n<li><h5> Commencement Certificate (For under-construction\nproperty):</h5>\n<p>This document states that the project meets the give\ncriteria and helps in the commencement of construction on\na site by the builder. Failing to acquire a Commencement\n certificate will result in the construction being considered\nillegal, levy penalties, and can even attract an eviction\nnotice.</p>\n\n\n\n\n\n\n<li><h5>Conversion Certificate (Agricultural to Non-Agricultural\nland):</h5>\n<p>A Conversion Certificate is issued to change the use of the\nland from agricultural to non-agricultural purpose from the\ncompetent revenue authority. There are a certain set of\ndocuments to be submitted by the owner to acquire a\nConversion Certificate. The documents required to obtain a\nConversion Certificate are;\n3 copies of the R.T.C extracts, Village map, land sketch,\ncertified copy of the land tribunal, zonal certificate, Title\ndeed, no dues certificate by village accountant, and\nMutation Records (MR) copy.\n</p>\n\n\n\n\n\n<li><h5>Khata Certificate and Khata Extract:</h5>\n<p>Khata is derived from the word ‘account’. It is an account of\na person owning a property. It typically consists of (a) Khata\nCertificate and (b) Khata Extract. Khata Certificate is\nmandatorily required for the registration of a new property and the transfer of a property. Khata Extract is nothing but\nobtaining the property details from the assessment\nregistrar. It is needed while property buying and acquiring\ntrade licenses.</p>\n\n\n\n<li><h5>. Encumbrance Certificate (EC):</h5>\n<p>Encumbrance means changes in the ownership or liabilities\ncreated on a property that is held against a home loan as\nsecurity. Simply put, it is a certificate sought for a particular\nperiod evidencing the property purchase/sale, the presence\nof any transaction or mortgage. Complete residential\naddress, property survey number, property location, the\nsought period, property description, its measurements, and\nboundaries should be mentioned in the Form. A nominal\nfee amount will be charged every year.</p>\n\n\n<li><h5>Betterment charges receipt:</h5> <p>Currently the developers\nare entitled to pay a fixed amount as betterment charges\nto the municipal body. A receipt of the same should be\nobtained at the time of property buying.</p>\n\n\n<img src=\"https://www.shareshell.in//utility/blog_image/addon/1628889373979.jpg\"  style=\"height:300px; width:100%; display:block; margin-left:auto; margin-right:auto;\" alt=\"house\">\n\n\n<h6>Here, is some useful links which you can go for</h6>\n<ul>\n<li><a href=\"https://iclg.com/practice-areas/real-estate-laws-and-regulations/india\" target=\"_blank\"> https://iclg.com/practice-areas/real-estate-laws-and-regulations/india</a>\n<li><a href=\"https://www.makaan.com/iq/legal-taxes-laws/5-real-estate-laws-you-must-know-about\" target=\"_blank\"> https://www.makaan.com/iq/legal-taxes-laws/5-real-estate-laws-you-must-know-about</a>\n\n<li><a href=\"https://step2knowledge.co.in/why-is-education-is-important-essay/\" target=\"_blank\"> https://step2knowledge.co.in/why-is-education-is-important-essay/</a>\n\n<li><a href=\"https://www.lawsenate.com/publications/articles/real-estate-laws-india.pdf\" target=\"_blank\">Law Senate Rules PDF</a>\n\n\n</ul>\n<p>To visit our website <a href=\"https://www.shareshell.in/\" target=\"_blank\">Click here</a></p>\n', '35.jpg', 'Home', 'ehlo, dskjfgas', '2021-08-14'),
