(65, '5', '', 'Dream Avenue Phase 2', 10000, '', 'near Banyan Courtyard, kalinga Vihar, patrapada, Bhubneswar', '', '9113776760', '65.jpg', 'mast hai yaar.. aakr kharid lo.. bohot shi cheez hai.. aao to ek baar yha. ab idhar random text dalunga, waise v kon pdhega itna.. aur tm kyu pdh rhe ho mjhe ye smgh nhi aa rha h.. aage random text hai, phle hi warn kr rha hu. ab to pdhna bnd kr do yaar.. hdd hai.. avi v pdh rhe ho.. bilkul hi jiddi ho kya .. choro, tm pdhte rho.. mera ab mn nhi h likhne ka.. random text stars in 3.....2.......1......Mohandas Karamchand Gandhi (/ˈɡɑːndi, ˈɡændi/;[1] 2 October 1869 – 30 January 1948) was an Indian lawyer,[2] anti-colonial nationalist,[3] and political ethicist,[4] who employed nonviolent resistance to lead the successful campaign for India\'s independence from British rule,[5] and in turn inspired movements for civil rights and freedom across the world. The honorific Mahātmā (Sanskrit: \"great-souled\", \"venerable\"), first applied to him in 1914 in South Africa, is now used throughout the world.[6][7]\r\n\r\nBorn and raised in a Hindu family in coastal Gujarat, western India, Gandhi trained in law at the Inner Temple, London, and was called to the bar at age 22 in June 1891. After two uncertain years in India, where he was unable to start a successful law practice, he moved to South Africa in 1893, to represent an Indian merchant in a lawsuit. He went on to live in South Africa for 21 years. It was in South Africa that Gandhi raised a family, and first employed nonviolent resistance in a campaign for civil rights. In 1915, aged 45, he returned to India. He set about organising peasants, farmers, and urban labourers to protest against excessive land-tax and discrimination. Assuming leadership of the Indian National Congress in 1921, Gandhi led nationwide campaigns for easing poverty, expanding women\'s rights, building religious and ethnic amity, ending untouchability, and above all for achieving Swaraj or self-rule.[8]', 'combined', 'bhubaneswar', '', '', 'rent', 'flat', '2', '2', '1', '2', '669', '', '', '', 'exit,fire,mess,', '', 'https://www.youtube.com/embed/DMRRC0rwO_I', '0000-00-00 00:00:00'),
